import styled from "styled-components";

export const FooterElement = styled.div` padding: 0% 12.5% 5% 0;
                                         font-size: 100%;
                                         margin-top: 0px;
                                         color: rgb(100, 100, 100);                  ` 
export const Footerd = styled.div`   width: 40%;
                                    margin-bottom: 100px;  `

export const Hr = styled.hr` wborder-color: rgb(251, 251, 251); `
